webpackJsonp([0x5d020936094b],{7663:function(e,t){e.exports={data:{post:{html:"<p>We're almost gone. We have a 6 am flight out of Hamburg in the morning, so we have to set the alarm for 3:30 or so. But with only one connection (our bet that <a href=\"http://www.papascott.de/archives/2006/05/04/northwest-pilots-agree-wage-cuts/\">NWA would keep flying</a> paid off), we get to Minneapolis at 11:45 am, so we'll have the whole day in front of us, so to speak.</p>\n<p>Like last year, we'll be at the lake with my parents. No landline, no cell coverage, no DSL, 1 TV channel. There are neighbors with open WLANs, so maybe we can sneak online once in a while. Or maybe not.</p>",fields:{title:"We're Outta Here",date:"02 Aug 2006",url:"https://papascott.de/2006-08-02-were-outta-here/"}}},pathContext:{slug:"/2006-08-02-were-outta-here/",prev:{fields:{title:"Men Not Working",date:"01 Aug 2006",slug:"/2006-08-01-men-not-working/"}},next:{fields:{title:"Wherever we go, that's where we are",date:"04 Aug 2006",slug:"/2006-08-04-wherever-we-go-thats-where-we-are/"}}}}}});
